import styled from "styled-components";

const HeaderContainer = styled.div`
//flex:1;
background: red;
padding: 0.3% 0.3%;
`
const ButtonContainer = styled.div`
  display: grid;
  grid-template-columns: 1fr 1fr 1rf;
  gap: 1rem;
`
const Button =styled.div`
width: 30%
`
export {
  HeaderContainer,
  ButtonContainer,
  Button
}
